const ReviewListItem = ({review}) => {
  return(
      <div>
          <div>
              <img className="wd-rounded-corners" height="50" width="50" src={review.profilePicture}/>
          </div>
        {review.review}
          {review.user}

      </div>
  )
}

export default ReviewListItem;
